    int niza[n];
    for(int i = 0; i < n; i++) {
        cin >> niza[i];
    }
    
    for(int i = 0; i  < n; i++) {
        for(int j = i + 1; j < n; j++) {
            if(niza[i] > niza[j]) {
                swap(niza[i], niza[j]);
            }
        }
    }
    
    int najgolem = n - 1;
    int najmal = 0;
    
    while(najgolem >= najmal) {
        cout << niza[najgolem] << " ";
        najgolem--;
        
        if(najgolem >= najmal) {
            cout << niza[najmal] << " ";
            najmal++;
        }
    }
    
    
    
    
    return 0;
}

